v8:item.v8:content:
- Меньше отчетности;
- Можно распоряжаться деньгами по собственному усмотрению;
- Дешевле открыть и просто закрыть;

- Производство и торговля алкоголем, кроме пива;  
- Разработка, производство и торговля оружием; 
- Частная охранная деятельность;  
- Деятельность связанная с созданием и управлением различными финансовыми фондами;
- Разработка, производство, ремонт авиационной техники;
- Производство лекарственных средств;
- Космическая деятельность.
